    }
    const onclk = (e) => {
        console.log(log);
    }
  return (
    <div>
        <Form>
        <div className='logincontainer'>
        <center>
            <h3>LOGIN</h3>
        <div className='loginformgroup'>
        <Form.Label>UserName</Form.Label>
        <Form.Control type='text' placeholder='Enter your Username'/>
